import React from "react";
import Tile from '../tile/Tile'; 

export const TileList = ({ tiles }) => {
  return (
    <div className="tile-list">
      {tiles?.map((tiles, index) => ( // check if items exists
        <Tile key={index} name={tiles.name} {...tiles} />
      ))}
    </div>
  );
};
